import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the notifications button to open the notification modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForLoadState('networkidle');

    // Wait for the notification elements to load
    await page.waitForSelector('.notification-time');

    // Extract all notification time elements
    const notificationTimes = await page.$$eval('.notification-time', elements => 
      elements.map(element => element.textContent.trim())
    );

    // Convert notification times to timestamps (this is a placeholder; actual conversion logic may vary)
    const timestamps = notificationTimes.map(time => new Date(time).getTime());

    // Take a screenshot of the notifications
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications.png'));

    return {
      success: true,
      action: "Collected notification time data for activity pattern analysis",
      extractedData: { timestamps },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

